import React from 'react'
import HotItemCard from ''

const HotAccessories = (music, musicCover) => {
    return (
        <div className="HotAccessories">
            <div>
                <img src={musicCover} alt="" />
            </div>
            <div>
                {music.map((item,index) =>
                <HotItemCard 
                key={item.key}
                name={item.name}
                price={item.image}
                index={index} />
                )}
            </div>
        </div>
    )
}

export default HotAccessories
